function App() {
  const router = createBrowserRouter([
    {
      path: '/',
      element:<main></main>,
      children: [
        {
          path: '/about',
          element: <About></About>
        },
        {
          path: '/products',
          // loader: () => fetch('https://assignment-12-pi.vercel.app/categories'),
          element: <Products></Products>
        }
      ]
    }
  ])
  return (
    <div >
      <RouterProvider router={router}></RouterProvider>
    </div>
  );
}



